import React, { Component } from 'react';

export class Form extends Component {
    render() {
        return (
            <section id="form" className="container">
                <div className="row">
                    <div className="col-md-6">
                        <h2>Get in Touch</h2>
                    </div>
                </div>
            </section>
        );
    }
}

export default Form;
